import React, {Fragment, Component} from "react";
import styled from "styled-components"

const ABC = styled.input`

border: dashed;
`;
class App extends Component {



    render () {
        return (
            <Fragment>
             <ABC></ABC>
            </Fragment>
        
        )

        
    
    }
}

export default App;
